
#
# TABLE STRUCTURE FOR: users
#

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `first_name` varchar(50) DEFAULT NULL,
  `last_name` varchar(50) DEFAULT NULL,
  `email` varchar(50) NOT NULL,
  `password` varchar(50) NOT NULL,
  `role` int(11) NOT NULL,
  `company` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=latin1;





#
# TABLE STRUCTURE FOR: stocks
#

DROP TABLE IF EXISTS `stocks`;

CREATE TABLE `stocks` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) NOT NULL,
  `quantity` decimal(15,2) DEFAULT NULL,
  `unit` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1001 DEFAULT CHARSET=latin1;


#
# TABLE STRUCTURE FOR: employees
#

DROP TABLE IF EXISTS `employees`;

CREATE TABLE `employees` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `first_name` varchar(50) NOT NULL,
  `last_name` varchar(50) NOT NULL,
  `email` varchar(50) NOT NULL,
  `start_hour` int(11) DEFAULT NULL,
  `end_hour` int(11) DEFAULT NULL,
  `age` int(11) DEFAULT NULL,
  `salary` int(11) NOT NULL,
  `job` varchar(150) NOT NULL,
  `turnover` int(11) DEFAULT NULL,
  `hire_date` date DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=151 DEFAULT CHARSET=latin1;


#
# TABLE STRUCTURE FOR: employee_advantage
#

DROP TABLE IF EXISTS `employee_advantage`;

CREATE TABLE `employee_advantage` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(150) NOT NULL,
  `value` int(11) NOT NULL DEFAULT 0,
  `employee_id` int(11) NOT NULL DEFAULT 0,
  PRIMARY KEY (`id`),
  KEY `FK_employee_advantage_employees` (`employee_id`),
  CONSTRAINT `FK_employee_advantage_employees` FOREIGN KEY (`employee_id`) REFERENCES `employees` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=1001 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: projects
#

DROP TABLE IF EXISTS `projects`;

CREATE TABLE `projects` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) NOT NULL,
  `client` varchar(50) NOT NULL,
  `release_date` date NOT NULL,
  `specs` text NOT NULL,
  `id_1` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `id_1` (`id_1`),
  CONSTRAINT `projects_ibfk_1` FOREIGN KEY (`id_1`) REFERENCES `employees` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1001 DEFAULT CHARSET=latin1;




#
# TABLE STRUCTURE FOR: project_meetings
#

DROP TABLE IF EXISTS `project_meetings`;

CREATE TABLE `project_meetings` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `datetime` datetime NOT NULL,
  `label` varchar(50) DEFAULT NULL,
  `id_1` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `id_1` (`id_1`),
  CONSTRAINT `project_meetings_ibfk_1` FOREIGN KEY (`id_1`) REFERENCES `projects` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2001 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: project_role
#

DROP TABLE IF EXISTS `project_role`;

CREATE TABLE `project_role` (
  `id` int(11) NOT NULL,
  `id_1` int(11) NOT NULL,
  `role` varchar(50) NOT NULL,
  PRIMARY KEY (`id`,`id_1`),
  KEY `id_1` (`id_1`),
  CONSTRAINT `project_role_ibfk_1` FOREIGN KEY (`id`) REFERENCES `employees` (`id`),
  CONSTRAINT `project_role_ibfk_2` FOREIGN KEY (`id_1`) REFERENCES `projects` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: project_steps
#

DROP TABLE IF EXISTS `project_steps`;

CREATE TABLE `project_steps` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(50) NOT NULL,
  `description` varchar(100) DEFAULT NULL,
  `id_1` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `id_1` (`id_1`),
  CONSTRAINT `project_steps_ibfk_1` FOREIGN KEY (`id_1`) REFERENCES `projects` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3001 DEFAULT CHARSET=latin1;


#
# TABLE STRUCTURE FOR: stock_history
#

DROP TABLE IF EXISTS `stock_history`;

CREATE TABLE `stock_history` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `quantity` decimal(15,2) NOT NULL,
  `datetime` datetime NOT NULL,
  `id_1` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `id_1` (`id_1`),
  CONSTRAINT `stock_history_ibfk_1` FOREIGN KEY (`id_1`) REFERENCES `stocks` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5001 DEFAULT CHARSET=latin1;

